import React from 'react';
import ReactDOM from 'react-dom';
import { BrowserRouter as Router, Route } from 'react-router-dom';// import './index.css';
import App from './App';
import Home from './App'
import DisplayColors from './components/DisplayColors'


ReactDOM.render(( 
  <Router>
    <div>
      <App />
      <Route exact path="/" component={App} />
      <Route exact path="/displaycolors" component={DisplayColors} />
    </div>
  </Router>),

    // <App />,
  document.getElementById('root')
);
